import Input from '../form/Input'
import Select from '../form/Select'
import SubmitButton from '../form/SubmitButton'
import styles from './CadastroForm.module.css'

export default function CadastroForm({btntext}){

    function pesquisaCEP(valor) {

        //Nova variável "cep" somente com dígitos.
        var cep = valor.replace(/\D/g, '');
    
        //Verifica se campo cep possui valor informado.
        if (cep !== "") {
    
            //Expressão regular para validar o CEP.
            var validacep = /^[0-9]{8}$/;
    
            //Valida o formato do CEP.
            if(validacep.test(cep)) {
    
                //Preenche os campos com "..." enquanto consulta webservice.
                document.getElementById('rua').value="...";
                document.getElementById('bairro').value="...";
                document.getElementById('cidade').value="...";
                document.getElementById('uf').value="...";
                document.getElementById('ibge').value="...";
    
                //Cria um elemento javascript.
                var script = document.createElement('script');
    
                //Sincroniza com o callback.
                script.src = 'https://viacep.com.br/ws/'+ cep + '/json/?callback=meu_callback';
    
                //Insere script no documento e carrega o conteúdo.
                document.body.appendChild(script);
    
            } //end if.
            else {
                //cep é inválido.
                alert("Formato de CEP inválido.");
            }
        } //end if.
        else {
            //cep sem valor, limpa formulário.
        }
    };

    return(
        <form className={styles.form}>
            <div className="row">
                <div className="col-md-4">
                    <Input type="text" text="Nome do candidato" name="name" placeholder="Insira o nome completo do candidato"/>
                </div>
                <div className="col-md-3">
                    <Input type="text" text="CPF" name="cpf" placeholder="CPF" />
                </div>
                <div className="col-md-3">
                    <Input type="text" text="RG" name="rg" placeholder="Número RG"/>
                </div>
                <div className="col-md-2">
                    <Select name="sexo" text="Selecione o sexo"/>
                </div>
            </div>
            <div className="row">
                <div className="col-md-2">
                    <Input type="date" name="datanascimento" text="Data de Nascimento"/>
                </div>
                <div className="col-md-2">
                    <Select name="estadocivil" text="Estado Civil"/>
                </div>
                <div className="col-md-2">
                    <Input type="number" name="idade" text="Idade" placeholder="Idade"/>
                </div>
                <div className="col-md-3">
                    <Input type="text" name="nacionalidade" text="Nacionalidade" placeholder="Nacionalidade"/>
                </div>
            </div>
            <div className="row">
                <div className="col-md-12">
                    <br/>
                    <h1>Dados de contatos</h1>
                </div>
                <div className="col-md-1"></div>
                <div className="col-md-3">
                    <Input type="text" name="telefone" text="Telefone" placeholder="(xx) x xxxx-xxxx"/>
                </div>
                <div className="col-md-3">
                    <Input name="whatsapp" type="text" text="WhatsApp" placeholder="(xx) x xxxx-xxxx"/>
                </div>
                <div className="col-md-4">
                    <Input name="email" type="email" text="E-mail" placeholder="email@email.com"/>
                </div>
            </div>
            <div className="row">
                <div className="col-md-12">
                <br/>
                    <h1>Dados de endereços</h1>
                </div>
                <div className="col-md-3">
                    <Input name="cep" type="text" text="CEP" placeholder="Informe seu CEP"/>
                </div>
                <div className="col-md-4">
                    <Input name="rua" type="text" text="Rua" placeholder="Nome da rua"/>
                </div>
                <div className="col-md-2">
                    <Input name="numero" type="text" text="Número" placeholder="Número"/>
                </div>
                <div className="col-md-3">
                    <Input name="complemento" type="text" text="Complemento" placeholder="Complemento"/>
                </div>

            </div>
            <div className="row">
                <div className="col-md-12 text-center">
                <SubmitButton text={btntext}/>
                </div>
            </div>
        </form>
    )
}
